import React from "react";
import { VictoryBar, VictoryChart, VictoryAxis, VictoryTheme } from 'victory';
import bannerImage from '../../assets/banners/Banner 3.jpg';

const data = [
    { year: '2018', achievements: 10 },
    { year: '2019', achievements: 15 },
    { year: '2020', achievements: 20 },
    { year: '2021', achievements: 25 },
    { year: '2022', achievements: 30 },
];

const Achievements = () => {
    return (
        <div className="achievements-page-container">
            <div className="achievements-banner" style={{ backgroundImage: `url(${bannerImage})` }}>
                <h1>Logros y Reconocimientos</h1>
                <p>Descubre nuestras destacadas contribuciones y logros.</p>
            </div>

            <div className="chart-container">
                <VictoryChart 
                  domainPadding={20}
                  theme={VictoryTheme.material}
                  animate={{
                    duration: 2000,
                    onLoad: { duration: 1000 }
                  }}
                >
                  <VictoryAxis
                    tickValues={[1, 2, 3, 4, 5]}
                    tickFormat={data.map(item => item.year)}
                  />
                  <VictoryAxis
                    dependentAxis
                    // Customizations can go here
                  />
                  <VictoryBar
                    data={data}
                    x="year"
                    y="achievements"
                    // Additional customizations can go here
                  />
                </VictoryChart>
            </div>

            <div className="achievements-content">
                {/* Tus logros aqu√≠ */}
            </div>
        </div>
    );
}

export default Achievements;
